import React from 'react';
import RecipeView from './components/RecipeView';

class RecipesToRender extends React.Component {
	render() {
        return (
            Recipes.map( item =>
                <RecipeView recipe={item} /> 
                )
        )
    }
}

export default RecipesToRender;
